import React from 'react';
import DvMenu from '../DVComponents/dvmenu';
import Login from '../DVComponents/login';
import {ProtectedRoute} from '../DVControllers/ProtectedRouter';
class App extends React.PureComponent<{}> {

    row = () => {
        var rows = [];
        var comp = <DvMenu/>;
        for (let i = 0; i<2; i++) {
            rows.push(comp);
        }
        return rows;
     }
    public render() {
        return (
            <div>
            <ProtectedRoute exact = "/app" component ={DvMenu}></ProtectedRoute>
            <ProtectedRoute exact = "/login" component ={Login}></ProtectedRoute>
            </div>
        );
    }
}

export default App;
